Base class for canonical factories used in KEfED.  Sets up
the persistence and entity manager and provides useful utility
routines for factories that generate specific canonicalized
results.

@author University of Southern California
@date $Date: 2011-07-06 17:57:37 -0700 (Wed, 06 Jul 2011) $
@version $Revision: 2554 $

