@param q The query to execute
@return The single return value or <code>null</code>

Factory for creating canonical data values. Canonical
data values will have a single individual representation
for each value that is considered to be the "same".

@author University of Southern California
@date $Date: 2011-07-12 14:47:42 -0700 (Tue, 12 Jul 2011) $
@version $Revision: 2575 $

Return the canonical ontology, creating it if
necessary.

@param fullName The ontology full, unique name
@return The canonical representation of this ontology.

Return the canonical ontology term, creating it if
necessary.

@param ont The ontology
@param id The ontology term id
@param type The ontology term type
@return The canonical representation of this ontology term.

Return the canonical ontology unit value, creating it if
necessary.

@param m The magnitude to canonicalize
@param u The unit expression to canonicalize
@return The canonical representation of this dimensioned number

public OntologyUnitsValue getOntologyUnitsValue (double m, Term u) {
Query q = em.createNamedQuery("ontologyunits.findCanonical");
q.setParameter("value", m);
q.setParameter("unit", u);
OntologyUnitsValue result = (OntologyUnitsValue) getResult(q);
if (result == null) {
result = new OntologyUnitsValue();
result.setValue(m);
result.setUnitTerm(u);
saveNewObject(result);
}
return result;
}

