Simple service to retrieve Scale based on the scale's name.

@param name
@return

@param name The attribute being measured
@param attributeOf The attribute base being measured
@param values The set of allowed values
@return The canonical nominal string scale for these items

public NominalStringScale getNominalStringScale(String name) {
Query q = em.createQuery("SELECT x FROM NominalStringScale x WHERE name = :name");
q.setParameter("name", name);

At this point we have a query for terms which match on
attributes and object, and where the values contains one
arbitrary value of the value set.  We need to go through
the returned values and find the one item that matches
all of the items.
@SuppressWarnings("unchecked")
List<NominalStringScale> results = q.getResultList();

if( results.size() > 1 ) {
throw new IllegalStateException("More than one NominalStringScale named" + name);
} else if (results.size() == 0) {
return null;
} else {
return results.get(0);
}

}
public void setNominalStringScale(NominalStringScale scale) {
List<String> values = scale.getAllowedValues();

assert !values.isEmpty() : "Values must have at least one entry";
removeDuplicates(values);
saveNewObject(scale);

}

@param name The name of the scale being measured
@return The canonical nominal ontology term scale for these items

@param attribute The attribute being measured
@param attributeOf The attribute base being measured
@param values The set of allowed values
@return The ordinal nominal string scale for these items

public OrdinalStringScale getOrdinalStringScale(String name) {
assert attribute != null && attributeOf != null : "Terms must be specified";
assert !values.isEmpty() : "Values must have at least one entry";
removeDuplicates(values); // This should really be an error.

Query q = em.createNamedQuery("SELECT x FROM OrdinalStringScale x WHERE name = :name");
q.setParameter("name", name);

At this point we have a query for terms which match on
attributes and object, and where the values contains one
arbitrary value of the value set.  We need to go through
the returned values and find the one item that matches
all of the items.
OrdinalStringScale result = null;
@SuppressWarnings("unchecked")
List<OrdinalStringScale> results = q.getResultList();

for (OrdinalStringScale s: results) {
if (values.equals(s.getAllowedValues())) {
if (result == null) {
result = s;
} else {
throw new IllegalStateException("More than one canonical value!");
}
}
}
if (result == null) {
result = new OrdinalStringScale();
result.setMeasuresAttribute(attribute);
result.setMeasuresAttributeOf(attributeOf);
result.setAllowedValues(values);
saveNewObject(result);
}
return result;
}


