Return the canonical integer scale, creating it if
necessary.  The minimum and maximum values are optional and
either one may be null.  If null then there is no minimum or
maximum respectively.  The inclusive flags indicate whether the
scale range includes the end point or not.  The circular flag
indicates if the scale is circular, for example a scale of
degrees of rotation which is in the range [0,360) and circular.

@param attribute The attribute being measured
@param attributeOf The attribute base being measured
@param min The minimum numeric value.  May be null.
@param minInclusive If the minimum value is inclusive
@param max The maximum numeric value. May be null.
@param maxInclusive If the maximum value is inclusive.
@param circular If the scale is a circular scale.
@return The canonical integer scale for these arguments.

public IntegerScale getIntegerScale (Term attribute,
Term attributeOf,
long min,
boolean minInclusive,
long max,
boolean maxInclusive,
boolean circular) {
assert attribute != null && attributeOf != null : "Terms must be specified";
IntegerScale result = null;
Query q;
if (min == null || max == null) {
Without min or max, we retrieve a set of candidates and
check for matches to min or max, since we can't put NULL values
into a standard query.
q = em.createNamedQuery("integerscale.findByMeasures");
q.setParameter("attribute", attribute);
@SuppressWarnings("unchecked")
List<IntegerScale> results = q.getResultList();

for (IntegerScale s: results) {
if (same(min, s.getMinimumValue())
&& same(max, s.getMaximumValue())
&& same(attributeOf, s.getMeasuresAttributeOf())
&& minInclusive == s.isMinimumIsInclusive()
&& maxInclusive == s.isMaximumIsInclusive()
&& circular == s.isCircular()) {
if (result == null) {
result = s;
} else {
throw new IllegalStateException("More than one canonical value!");
}
}
}
} else {
q = em.createNamedQuery("integerscale.findCanonical");
q.setParameter("attribute", attribute);
q.setParameter("object", attributeOf);
q.setParameter("min", min);
q.setParameter("mininclusive", minInclusive);
q.setParameter("max", max);
q.setParameter("maxinclusive", maxInclusive);
q.setParameter("circular", circular);
result = (IntegerScale) getResult(q);
}

if (result == null) {
result = new IntegerScale();
result.setMeasuresAttribute(attribute);
result.setMeasuresAttributeOf(attributeOf);
result.setMinimumValue(min);
result.setMinimumIsInclusive(minInclusive);
result.setMaximumValue(max);
result.setMaximumIsInclusive(maxInclusive);
result.setCircular(circular);
saveNewObject(result);
}
return result;
}

