Abstract Measurement Scale object.  Measurement scale objects will
be canonical objects that are defined by what they measure and the
description of what constrains the measurement.

The name and description will <b>not</b> be part of the
canonicalization process.  Those elements can be changed without
changing the identity of the measurement scale.  The scale constraints
cannot be changed without changing the identity.

