Relative term scale, where an anonymous term is defined by
a combination of a class that it belongs to, one of a set
of properties and a set of other terms that it is related to
by a chosen property.

An example would be an anonymous region defined as being
part of another region or a different anonymous region defined
as overlapping several regions.

