@return The full, unique name of the ontology.

A larger descriptive string for this ontology.
Not part of the canonical criteria.

@return A description of this ontology

A relative ontology term is an anonymous ontology term of a given type that is defined relative to other ontology terms. This allows for the specification of specialized terms that do not exist in an ontology and for which it doesn't make sense to create a named term.
One example would be the creation of subregions of named regions, as in the tract-tracing experiments. Such a subregion will be a region that is part-of or overlapping with another region or regions. Such an example would look like Type: BrainRegion (an ontology class term) Relation: PartOf (an ontology binary property) Values: {Subiculum} (an ontology individual)
